import React from "react";
import FlipCard from '../FlipCard'
import Road from "../Road"
import {Bar, Doughnut, Polar, Radar, HorizontalBar} from 'react-chartjs-2';
function RoadLevel5(props) {

    var options = {
      scales:
      {
        yAxes: [{
          ticks: {
            display: false
          },
          gridLines: {
            drawBorder: false,
            display: false,
            tickMarkLength: false
          }          
        }]
      },
      legend: 
      {display: true, position: "bottom", labels:
        {
          fontColor:'#FFFFFF'
        }
      }
    }

    return (
        <div>
          <div style={{display:'flex',flexDirection:'column'}}>
            <div style = {{display: 'flex', flexDirection: 'row', top: '160px'}}>                
                <Road 
                width={'160px'}
                height= {'160px'}
                StylingInfo = {'horizontal-road1'}
                dashType = 'horizontal-dash'/>
                 <Road 
                width={'160px'}
                height= {'160px'}
                StylingInfo = {'horizontal-road1'}
                dashType = 'horizontal-dash'/>
                 <Road 
                width={'160px'}
                height= {'160px'}
                StylingInfo = {'horizontal-road1'}
                dashType = 'horizontal-dash'/>
                 <Road 
                width={'160px'}
                height= {'160px'}
                StylingInfo = {'horizontal-road1'}
                dashType = 'horizontal-dash'/>
                <FlipCard
                  width = {"25em"}
                  height = {"25em"}
                  FlipStyle = {{ backgroundImage:'url("/softSkills.jpg")', 
                  backgroundRepeat: 'no-repeat',
                  backgroundSize: '110%',
                  backgroundPosition: 'center'}}
                  Back = {
                    <div style={{height:'20em'}}>
                       <Radar 
                      data = {props.softSkillsChartData}
                      options = {options}
                      />
                    </div>
                     
                      }
                >
                </FlipCard>
            </div>
          </div>
        </div>
        )              
}

export default RoadLevel5;
